import React from 'react';
import styles from '../styles/Contact.module.css';

const Contact = () => {
    return (
        <section className="section">
            <div className="container">
                <h2 className="section-title">Contacto</h2>
                <div className={styles.contactContainer}>
                    <h2 className={styles.contactTitle}>¡Ponte en contacto conmigo!</h2>
                    <div className={styles.contactInfo}>
                        <p><i className="fas fa-envelope"></i> Email: <a href="mailto:marta.cuevas@email.com">marta.cuevas@email.com</a></p>
                    </div>
                    <div className={styles.contactInfo}>
                        <p><i className="fas fa-phone"></i> Teléfono: <a href="tel:+34123456789">+34 123 456 789</a></p>
                    </div>
                    <div className={styles.contactInfo}>
                        <p><i className="fab fa-linkedin"></i> LinkedIn: <a href="https://linkedin.com/in/martacuevas" target="_blank" rel="noopener noreferrer">linkedin.com/in/martacuevas</a></p>
                    </div>
                    <div className={styles.contactInfo}>
                        <p><i className="fas fa-map-marker-alt"></i> Ubicación: Madrid, España</p>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default Contact;
